import React from 'react';
import '../App.css';
import { useNavigate, Navigate, Link } from 'react-router-dom';
import Grid from '@mui/material/Grid';
// import axios from 'axios';
import {
  Button,
  CssBaseline,
  TextField,
  Typography,
  Container,
  List,
  ListItem,
  Divider,
  ListItemText,
} from '@mui/material';
import { styled } from '@mui/system';
import { createTheme, ThemeProvider } from '@mui/material/styles';

import experiencesData from '../data/ExperienceData';

const defaultTheme = createTheme();

const Box = styled('div')({
  display: 'flex',
  height: '100%',
  border: '1px solid #6D8472',
  borderRadius: '15px',
  padding: '10px'
});

const Item = styled('div')({
  display: 'flex',
  flexDirection: 'column',
  padding: '10px',
});

const ProgButton = styled('button')({
  backgroundColor: '#0171e3',
  width: '430px',
  height: '50px',
  margin: '10px',
  color: 'white',
  padding: '5px 10px',
  border: 'none',
  borderRadius: '5px',
  alignSelf: 'center'
});

const ExperienceBox = ({ id, title, subtitle, description, items }) => {
  <Grid item xs={4}>
    <Box>
      <Grid sx={{ flexGrow: 1, height: "100%" }} container spacing={2}>
        <Grid item xs={12} sx={{ height: "20%" }}>
          <Item className="subscription-head" id={id}>
            {subtitle && <Typography sx={{ fontSize: ".7rem" }}>
              {subtitle}
            </Typography>}
            <Typography sx={{ fontSize: "1.4rem" }}>
              {title}
            </Typography>
            <Typography sx={{ fontSize: ".7rem" }}>
              {description}
            </Typography>
          </Item>
        </Grid>
        <Grid item xs={12} sx={{ height: "80%" }}>
          <List sx={{ padding: "0", width: "100%", maxWidth: "500px"}}>
            {items.map((item, index) => (
              <React.Fragment key={index}>
                <ListItem alignItems="flex-start">
                  <ListItemText
                    primary={item.primary}
                    secondary={
                      <>
                        {item.secondary && <Typography style={{ color: "#e8e5df", fontStyle:"italic", fontSize: ".8rem" }}>
                          {item.secondary}
                        </Typography>}
                        <Typography style={{ color: "#e8e5df", fontWeight:"lighter", fontSize: ".8rem"}}>
                          {item.details}
                        </Typography>
                      </>
                    }
                  />
                </ListItem>
                {index < items.length - 1 && <Divider variant="middle" component="li" sx={{ backgroundColor: "#6D8472" }} />}
              </React.Fragment>
            ))}
          </List>
        </Grid>
      </Grid>
    </Box>
  </Grid>
}

function Experiences({ token, setTokenFunction }) {
  const navigate = useNavigate();

  // this should save the experience selected.
  const goToProjects = () => {
    navigate('/projects')
  }

  return (
    <div sx={{ display: 'flex', flexDirection: 'column', alignContent: 'center', justifyContent: 'center' }}>
      <Container component="main" maxWidth="md" sx={{ display: 'flex', flexDirection: 'column', paddingBottom: '50px' }}>
        <Typography sx={{ fontSize: '1rem', color: '#a7a396' }}>
          Step <b>1</b> of <b>3</b>
        </Typography>
        <Typography sx={{ fontSize: '2rem', fontWeight: '500' }}>
          Choose an Experience
        </Typography>
        <Grid sx={{ flexGrow: 1 }} container spacing={2}>
          {experiencesData.map((experience) => (
            <ExperienceBox key={experience.id} {...experience} />
          ))}
        </Grid>
      </Container>
      <div style={{ display: 'flex', justifyContent: 'center', width: '100%' }}>
        <ProgButton onClick={goToProjects}>Next</ProgButton>
      </div>
    </div>
  );
}

export default Experiences;
